import React, { useState } from 'react';
import "./Newsletter.css";

const Newsletter = () => {
  const [subscribers, setSubscribers] = useState([
    { id: 1, email: 'etudiant1@ece.fr', name: 'Jean Dupont', subscriptionDate: '2024-01-15' },
    { id: 2, email: 'professeur@ece.fr', name: 'Marie Martin', subscriptionDate: '2024-02-20' },
    { id: 3, email: 'admin@ece.fr', name: 'Admin ECE', subscriptionDate: '2024-03-10' }
  ]);

  const [newSubscriber, setNewSubscriber] = useState({ email: '', name: '' });
  const [newsletterContent, setNewsletterContent] = useState('');

  const handleAddSubscriber = (e) => {
    e.preventDefault();
    if (newSubscriber.email && newSubscriber.name) {
      setSubscribers(prev => [
        ...prev,
        {
          id: prev.length + 1,
          email: newSubscriber.email,
          name: newSubscriber.name,
          subscriptionDate: new Date().toISOString().split('T')[0]
        }
      ]);
      setNewSubscriber({ email: '', name: '' });
    }
  };

  const handleRemoveSubscriber = (id) => {
    setSubscribers(prev => prev.filter(sub => sub.id !== id));
  };

  const handleSendNewsletter = () => {
    // Ici, vous implémenteriez l'envoi de la newsletter
    alert(`Newsletter envoyée à ${subscribers.length} abonnés !`);
    setNewsletterContent('');
  };

  return (
    <div className="newsletter">
      <h1>Gestion de la Newsletter Développement Durable</h1>

      <div className="newsletter-sections">
        <section className="subscribers-section">
          <h2>Abonnés à la newsletter ({subscribers.length})</h2>
          
          <form onSubmit={handleAddSubscriber} className="add-subscriber-form">
            <input
              type="text"
              placeholder="Nom"
              value={newSubscriber.name}
              onChange={(e) => setNewSubscriber({...newSubscriber, name: e.target.value})}
              required
            />
            <input
              type="email"
              placeholder="Email"
              value={newSubscriber.email}
              onChange={(e) => setNewSubscriber({...newSubscriber, email: e.target.value})}
              required
            />
            <button type="submit" className="btn btn-primary">Ajouter</button>
          </form>

          <div className="subscribers-list">
            {subscribers.map(subscriber => (
              <div key={subscriber.id} className="subscriber-item">
                <div className="subscriber-info">
                  <h4>{subscriber.name}</h4>
                  <p>{subscriber.email}</p>
                  <small>Inscrit le: {subscriber.subscriptionDate}</small>
                </div>
                <button 
                  onClick={() => handleRemoveSubscriber(subscriber.id)}
                  className="btn btn-danger"
                >
                  Désabonner
                </button>
              </div>
            ))}
          </div>
        </section>

        <section className="compose-section">
          <h2>Rédiger une nouvelle newsletter</h2>
          
          <textarea
            placeholder="Contenu de votre newsletter..."
            value={newsletterContent}
            onChange={(e) => setNewsletterContent(e.target.value)}
            rows="10"
          />
          
          <div className="newsletter-actions">
            <button 
              onClick={handleSendNewsletter} 
              className="btn btn-primary"
              disabled={!newsletterContent || subscribers.length === 0}
            >
              Envoyer la newsletter
            </button>
            <button className="btn btn-secondary">Enregistrer comme brouillon</button>
          </div>
        </section>
      </div>
    </div>
  );
};

export default Newsletter;
